struct TickerResponse: Codable {
    let id: String?
    let name: String?
    let symbol: String?
    let priceUSD: Double?
    let priceBTC: Double?

    private enum CodingKeys: String, CodingKey {
        case id
        case name
        case symbol
        case priceUSD = "price_usd"
        case priceBTC = "price_btc"
    }

    init(from decoder: Decoder) throws {
        let container = try decoder.container(keyedBy: CodingKeys.self)
        id = try? container.decode(String.self, forKey: .id)
        name = try? container.decode(String.self, forKey: .name)
        symbol = try? container.decode(String.self, forKey: .symbol)
        if let price_usd = try? container.decode(String.self, forKey: .priceUSD) {
            priceUSD = Double(price_usd)
        } else {
            priceUSD = nil
        }
        if let price_btc = try? container.decode(String.self, forKey: .priceBTC) {
            priceBTC = Double(price_btc)
        } else {
            priceBTC = nil
        }
    }
}

let data = coinMarketCapJSON.data(using: .utf8)!
do {
    let tickerResponse = try JSONDecoder().decode([TickerResponse].self, from: data)
    print(tickerResponse)
} catch {
    print(error)
}
